import React from "react";
const bigSkills = ["being awesome"];
const mediumSkills = ["javascript"];
const smallSkills = ["ruby and thomas the rails engine"];
let skills = bigSkills.concat(mediumSkills).concat(smallSkills);

function shuffle(array) {
  for (let i = array.length - 1; i > 0; i--) {
    let j = Math.floor(Math.random() * (i + 1));
    [array[i], array[j]] = [array[j], array[i]];
  }
}

function Skills() {
  return (
    <div id="skills-section" className="section">
      <h4>Skills</h4>
      {console.log("skillzzz", skills)}
      <ul id="skills-ul">
        <li className="big-skill">here</li>
        <li>is</li>
        <li>the</li>
        <li className="small-skill">news</li>
        <li>- ELO</li>
      </ul>
      <em>//here are the skills</em>
    </div>
  );
}

export default Skills;
